func = Function(([Integer, List(Integer), Set(Bool)], Bool), ([Bool, Bool,
    Set(Set(Bool))], Integer), ([Integer, Integer], Void))
file = StringIO()
errors = ErrorsOutput(file)
errors.max_width = 32
errors.write_function_overloads('function', func)
expected = """Function arguments:
    function(int, list of int, 
             set of bool): bool
    function(bool, bool, 
             set of set of bool
            ): int
    function(int, int)

"""
actual = file.getvalue()
assert expected == actual
